import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function LoginPage({ setRole }) {
    const [email, setEmail] = useState('');  // Email (if used in the future)
    const [password, setPassword] = useState('');  // Password field
    const [srn, setSrn] = useState('');  // For student SRN
    const [gId, setGId] = useState('');  // For teacher G_ID
    const [userRole, setUserRole] = useState('student');  // Default role is 'student'
    const navigate = useNavigate();

    const handleLogin = () => {
        // Perform validation based on role and password
        if (!password) {
            alert("Please enter your password.");
            return;
        }

        if (userRole === 'student' && srn) {
            setRole('student');
            navigate('/student');
        } else if (userRole === 'teacher' && gId) {
            setRole('teacher');
            navigate('/teacher');
        } else {
            alert("Please enter the required details.");
        }
    };

    const handleCreateAccount = () => {
        // Redirect to the account creation page
        navigate('/create-account');
    };

    return (
        <div>
            <h2>Login</h2>

            <label>
                Select Role:
                <select value={userRole} onChange={(e) => setUserRole(e.target.value)}>
                    <option value="student">Student</option>
                    <option value="teacher">Teacher</option>
                </select>
            </label>
            <br />

            {userRole === 'student' ? (
                <div>
                    <label>
                        SRN:
                        <input 
                            type="text" 
                            value={srn} 
                            onChange={(e) => setSrn(e.target.value)} 
                            placeholder="Enter SRN"
                        />
                    </label>
                    <br />
                </div>
            ) : (
                <div>
                    <label>
                        G_ID:
                        <input 
                            type="text" 
                            value={gId} 
                            onChange={(e) => setGId(e.target.value)} 
                            placeholder="Enter G_ID"
                        />
                    </label>
                    <br />
                </div>
            )}

            <label>
                Password:
                <input 
                    type="password" 
                    value={password} 
                    onChange={(e) => setPassword(e.target.value)} 
                    placeholder="Enter Password"
                />
            </label>
            <br />
            <button onClick={handleLogin}>Login</button>
            <button onClick={handleCreateAccount}>
                Create Account
            </button>
        </div>
    );
}

export default LoginPage;
